import './App.css';
import Data from "./components/Data/Data";
import { Route, BrowserRouter as Router, Routes } from "react-router-dom";
import { ErrorBoundary } from "react-error-boundary";
import { ErrorFallback } from "./components/Error/ErrorFallback";
import AddData from "./components/AddData/AddData";
import SearchAndFilter from "./components/SearchAndFilter/SearchAndFilter";
import Navbar from "./components/Navbar/Navbar";
import Footer from "./components/Footer/Footer";
import React, {useState} from "react";

const App = () => {
    const [activeContext, setActiveContext] = useState('user');
    return (


        <div className="App">
            <button onClick={() => setActiveContext('user')}>Switch to User Context</button>
            <button onClick={() => setActiveContext('another')}>Switch to Another Context</button>

            {activeContext === 'user' ? (
                <UserProvider>
                    <SearchAndFilter />
                </UserProvider>
            ) : (
                <AnotherProvider>
                    <AnotherComponent />
                </AnotherProvider>
            )}

            <ErrorBoundary FallbackComponent={ErrorFallback}>
            <Router>
                <Navbar />
                <main>
                    <Routes>
                            <Route path="/" element={<Data />} />
                            <Route path="/add-data" element={<AddData />} />
                            <Route path="/search-data" element={<SearchAndFilter />} />
                    </Routes>
                </main>
                <Footer />
            </Router>
            </ErrorBoundary>
        </div>
    );
}

export default App;
